import React from "react";
import { Link } from "react-router-dom";

const RatingQuestion = (props) => {
  const name = props.name;

  return (
    <div className="question">
      <h3>{props.question}</h3>

      <div className="radios">
        <h6>Disagree</h6>
        <input
          type="radio"
          onSelect={(e) => props.getValue(props.name, e.target.id)}
          id="1"
          name="s1"
        />
        <input
          type="radio"
          onSelect={(e) => props.getValue(props.name, e.target.id)}
          id="2"
          name="s1"
        />
        <input
          type="radio"
          onSelect={(e) => props.getValue(props.name, e.target.id)}
          checked="true"
          id="3"
          name="s1"
        />
        <input
          type="radio"
          onSelect={(e) => props.getValue(props.name, e.target.id)}
          id="4"
          name="s1"
        />
        <input
          type="radio"
          onSelect={(e) => props.getValue(props.name, e.target.id)}
          id="5"
          name="s1"
        />
        <h6>Agree</h6>
      </div>
    </div>
  );
};

export default RatingQuestion;
